INSERT INTO `information_object_i18n` VALUES (NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'en'),('Teste',NULL,NULL,'teste',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,444,'en'),('Universidade AVMB',NULL,NULL,'Papel.\nDigital.\nEletrnico.','Os documentos de guarda permanente custodiados pelo Arquivo Central foram recolhidos ao antigo Centro de Documentao, criado em 1986 como Centro de Documentao e Arquivo da Universidade da AVMB (CEDAQ) pelo Ato da Reitoria N 345/86 de agosto de 1986. Foi constitudo como Centro de Documentao (CEDOC) pelo Ato da Reitoria N 596/88, de 24 de outubro de 1988.\nA Resoluo do Conselho Universitrio n 0002, de 19 de fevereiro de 2014, publicada no Dirio Oficial da Unio em 26 de fevereiro de 2014 extinguiu o Centro de Documentao e a Subsecretaria de Comunicao Administrativa (SCA) e criou o Arquivo Central. O Regimento Interno do ACE foi aprovado pela Resoluo do Conselho Universitrio n19, de 24 de julho de 2015 e publicado no Dirio Oficial da Unio em 29 de julho de 2015.\n\nA Universidade de AVMB foi inaugurada em 15 de dezembro de 1995. Atualmente, possui 2.445 professores, 2.630 tcnicos-administrativos e 28.570 alunos regulares e 6.304 de ps-graduao.  constituda por 26 institutos e faculdades e 21 centros de pesquisa especializados.\nOferece 109 cursos de graduao, sendo 31 noturnos e 10 a distncia. H ainda 147 cursos de ps-graduao stricto sensu e 22 especializaes lato sensu. Os cursos esto divididos em quatro campi espalhados pelo Rio Grande do Sul: Sede (Santa Maria), Braslia, So Paulo e Porto Alegre. Os rgos de apoio incluem o Hospital Universitrio, a Biblioteca Central, o Hospital Veterinrio e a Fazenda gua Limpa.',NULL,'A documentao custodiada pelo Arquivo Central da UAVMB conta com documentos administrativos e acadmicos como resultado das atividades da Universidade. Existem no fundo, documentos que remetem  criao da Universidade, mas de forma estruturada e como mais pesquisados existe a srie Atos, Resolues e Instrues (ARINS) produzida pelo Gabinete do Reitor, Conselhos e Decanatos e outras unidades administrativas. Existem ainda atas de reunies e alguns documentos da atividade acadmica produzidos pela Escola de Extenso e pela Secretaria de Administrao Acadmica. ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,519,'pt_BR'),('Reitoria',NULL,NULL,NULL,NULL,NULL,'A seo reitoria rene os documentos do gabinete da reitoria e da vice-reitoria. Tendo com isso os documentos de arquivo acumulados nas atribuies do Reitor e do Vice-Reitor da Universidade.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,522,'pt_BR'),('Gabinete do Reitor',NULL,NULL,'Papel e cpias digitais. Gnero textual: 10,5 metros lineares de documentos em suporte papel (75 caixas arquivo).\nOs atos, resolues e instrues produzidos at o dia 16 de maio de 2016 esto no Arquivo Central, a partir desta data os documentos passaram a ser produzidos pelo SEI. Os atos do ano de 2017 esto sendo inseridos e descritos nesta plataforma pelo Centro de Informtica.','O Gabinete do Reitor tem por finalidade propiciar ao Reitor, diretamente, os elementos necessrios ao exerccio de suas funes. Criado por ocasio da Lei n 3.998 de 15 de dezembro de 1961 que autoriza o Poder Executivo a instituir a Fundao Universidade de Braslia.',NULL,'Os documentos dessa srie abrangem os atos, resolues e instrues emanados pelo Gabinete do Reitor.\nO conjunto  composto por atos da Reitoria que tratam de assuntos relativos  representao da universidade, alterao da estrutura administrativa e acadmica, administrao de finanas, exerccio do poder disciplinar, delegao de atribuies, apresentao de projetos e propostas, dispensa, reconduo e admisso de pessoal docente e tcnico-administrativo, designao de chefes superiores, promoo, extino e criao de cargos, aplicao de penas de suspenso, instituio de comisses para estudo de problemas especficos e outras aes administrativas e acadmicas. Contm, em geral, documentos que tratam de assuntos relativos  administrao geral: modernizao e reforma administrativa, planos e programas de trabalho, relatrios de atividades, regimentos e regulamentos, estatutos e organogramas.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,527,'pt_BR'),('Atos, Resolues e Instrues da Reitoria',NULL,NULL,NULL,NULL,NULL,'Os documentos dessa srie abrangem os atos, resolues e instrues emanados do Gabinete do Reitor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,533,'pt_BR'),('Atos da Reitoria',NULL,NULL,'Papel',NULL,NULL,'Conjunto dos Atos da Reitoria recolhidos ao Arquivo Central desde 1964.\n possvel encontrar tambm os Atos da Reitoria dos anos de 2016 e 2017.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,534,'pt_BR'),('Atos da Reitoria 1995',NULL,NULL,'Papel.',NULL,NULL,'Dossi composto pelos Atos da Reitoria do ano de 1964. Nesse dossi encontra-se apena o Ato da Reitoria N 29/64, que trata sobre a criao de secretarias administrativas no mbito de algumas unidades acadmicas. Os atos restantes no foram recuperado/ enviados ao Arquivo Central.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,536,'pt_BR'),('Ato da Reitoria N 1/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,537,'pt_BR'),('Ato da Reitoria N 2/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,541,'pt_BR'),('Ato da Reitoria N 3/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,545,'pt_BR'),('Ato da Reitoria N 4/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,549,'pt_BR'),('Ato da Reitoria N 5/1995',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,553,'pt_BR'),('Vida acadmica dos alunos dos cursos de graduao',NULL,NULL,NULL,NULL,NULL,'A documentao custodiada pelo Arquivo Permanente da UAVMB conta com documentos acadmicos referentes  vida acadmica dos estudantes e necessrios para comprovar seus estudos. Existem no fundo diplomas, histrico escolar, dentre outros documentos necessrios a comprovao da graduao.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,557,'pt_BR'),('Documentao Acadmica',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,559,'pt_BR'),('Emisso de Diploma',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,560,'pt_BR'),('Registro',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,561,'pt_BR'),('Aluno Daenerys Targaryen',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,586,'pt_BR'),('Aluno Isadora Rios Souza',NULL,NULL,'Documentos',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,602,'en'),('Graduao AVMB',NULL,NULL,'Dimenso: 10 metros lineares\nSuporte: Papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,937,'pt_BR'),('Curso Cincia da Computao',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,938,'en'),('Departamento de Cincia da Informao',NULL,NULL,'Dimenso: 3 metros lineares\nSuporte: papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,938,'pt_BR'),('Documentao Acadmica',NULL,NULL,'Dimenso: 1 metro linear\nSuporte: papel',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,940,'pt_BR'),('Assentamentos Individuais dos Alunos (Dossi dos Alunos)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,942,'pt_BR'),('Aluna Carolina Maria',NULL,NULL,'Dimenso: 4 fo