INSERT INTO `static_page_i18n` VALUES ('Willkommen','Das ist die standardmige Homepage von AtoM. Dabei handelt es sich um eine Beta-Version, die nach wie vor weiter entwickelt und getestet wird.\n\nAtoM ist eine vollstndig webbasierte Anwendung zur Archiverschlieung. Sie basiert auf den Standards des <a href=\"http://www.ica.org/\">Internationalen Archivrats</a> (ICA). <i>AtoM</i> ist ein Akronym fr <i>Access to Memory</i>.\n\nDer ICA und seine <a href=\"http://ica-atom.org/about#partners\">Projekpartner</a> machen diese Anwendung als Open-Source-Software zugnglich, um archivischen Institutionen eine frei zugnglichen und einfach zu benutzende Mglichkeit anzubieten, ihre Bestnde online vorzustellen. Auf der Seite <a href=\"about\">ber AtoM</a> erfahren Sie Nheres zum Projekt.\n\n<h2>Hilfe</h2>\n\nBentzen Sie das online <a href=\"http://ica-atom.org/docs\">Bentzerhandbuch</a> um mehr ber die Funktionen dieses Programms zu erfahren oder whlen Sie die Schaltflche\n<i>blttern</i>, um einige Beispieldaten zu sehen.',7,'de'),('Bem-vindo','Pgina padro de apresentao do AtoM.',7,'en'),('Bienvenido','Esta es la pgina por defecto de AtoM.\n\nAtoM es una aplicacin diseada para la descripcin de archivos con soporte web completo basada en los estndares del <a href=\"http://www.ica.org/\">Consejo Internacional de Archivos</a> (CIA/ICA). <i>AtoM</i> es el acrnimo de <i>Access to Memory</i> (Acceso a la Memoria).\n\nEl CIA/ICA y sus <a href=\"http://ica-atom.org/about#partners\">colaboradores</a> en el proyecto estn desarrollando esta aplicacin de recursos de software abierto para que las instituciones archivsticas puedan hospedar online su informacin de un modo fcil y gratuito. Consulte <a href=\"acerca\">about page</a> para conocer ms informacin acerca del proyecto AtoM.\n\nConsulte la <a href=\"http://ica-atom.org/docs\">documentacin</a> online para saber ms acerca de cmo usar el software o presione el botn <i>navegar</i> situado en la parte derecha de la pantalla para ver algunos ejemplos',7,'es'),('Bienvenue','Vous tes sur la page daccueil dAtoM. Il sagit dune version bta encore en phase active de dveloppement et de test.\n\nAtoM est une application Web de description archivistique qui repose sur les normes du <a href=\"http://www.ica.org/ \"> Conseil International des Archives</a>(CIA). <i>AtoM</i> est un acronyme signifiant: <i> Access to Memory </i> [Accs  la Mmoire].\n\nLe CIA et <a href=\"http://ica-atom.org/about#partners\">ses partenaires associs au projet</a> veillent  faire de cette application un logiciel libre afin de fournir aux services darchives une solution gratuite et facile demploi pour la mise en ligne de leurs fonds darchives. Pour en apprendre plus sur le projet du CIA, voyez la <a href=\"about\">page   propos </a>.\n\nConsultez la <a href=\"https://www.ica-atom.org/doc/Main_Page/fr \">documentation en ligne</a> pour en apprendre plus sur lutilisation du logiciel , ou bien cliquez sur le bouton <i>Naviguer </i>  droite pour voir quelques exemples de donnes en ligne.',7,'fr'),('Benvido','Esta  a pxina por defecto de AtoM. Esta  a versin beta que anda esta en desenvolvemento e proba.\n\nAtoM  unha aplicacin completa baseada na web para a descricin arquivstica. Emprega os estndares do <a href=\"http://www.ica.org/\">Consello Internacional de Arquivos </a> (ICA). <i>AtoM</i>  o acrnimo de <i>Acceso  Memoria </i>.\n\nO ICA e os seus <a href=\"http://ica-atom.org/about#partners\">colaboradores no proxecto </a> estn traballando para que a aplicacin sexa dispoible como software de cdigo aberto e proporcione s institucins arquivsticas unha opcin de balde e doada de empregar para publicar en lia as sas coleccins arquivsticas. Vexa a <a href=\"about\">pxina about</a> para aprender mis sobre o proxecto AtoM.\n\nVexa a documentacin <a href=\"http://ica-atom.org/docs\">online</a> para aprender mis sobre o uso do software e prema o botn <i>examinar</i>  dereita para ver algns exemplos.',7,'gl'),('Selamat Datang','Ini adalah halaman utama AtoM. Ini adalah versi beta yang masih dalam pengembangan dan pengujian secara aktif.\n\nAtoM adalah aplikasi berbasis web untuk deskripsi arsip yang berdasar pada <a href=\"http://www.ica.org/\"> International Council on Archives</a> (ICA) standar. <i>AtoM</i> adalah singkatan dari <i>Access to Memory</i>.\n\nICA dan rekanannya <a href=\"http://ica-atom.org/about#partners\">proyek  kolaborator</a> membuat aplikasi ini sebagai aplikasi <i>open source</i> agar dapat mendukung institusi arsip secara terbuka dan memudahkan untuk mengelola koleksi arsip mereka secara online.\n\nLihat <a href=\"about\">Tentang AtoM</a> untuk mempelajari lebih lanjut tentang proyek aplikasi AtoM.\n\nLihat online <a href=\"http://ica-atom.org/docs\">dokumentasi</a> untuk mempelajari lebih lanjut menggunakan aplikasi ini atau gunakan <i>browse</i> pada bagian kanan untuk melihat beberapa sample data.',7,'id'),('Benvenuti','Questa  la pagina predefinita di AtoM.\n\nAtoM  un applicazione per la descrizione archivistica interamente online, basata sugli standard dell\'<a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA). AtoM  un acronimo per <i>Access to Memory</i>.\n\nICA e i suoi <a href=\"http://ica-atom.org/about#partners\">collaboratori nel progetto</a> stanno sviluppando questa applicazione open source per fornire alle istituzioni archivistiche una semplice e gratuita opzione per rendere disponibile in linea il loro patrimonio archivistico. Si veda la pagina delle <a href=\"about\">informazioni</a> per ulteriori indicazioni sul progetto AtoM.\n\n possibile consultare la <a href=\"http://ica-atom.org/docs\">documentazione</a> per informazioni su come utilizzare il software o, utilizzando il pulsante <i>naviga</i> sulla destra,  possibile vedere alcuni esempi.',7,'it'),('','AtoM<a href=\"http://www.ica.org/\"></a> ICA AtomAccess to Memory\n\nICA<a href=\"http://ica-atom.org/about#partners\"> </a>ICA Atom <a href=\"about\">about page</a> \n\n<a href=\"http://ica-atom.org/docs\">documentation</a>  <i>browse</i> ',7,'ja'),('','  AtoM   .        ,       .\n\nAtoM       ,   <a href=\"http://www.ica.org/\">  </a> (ICA) . <i>AtoM</i>  <i>Access to Memory</i> .\n\nICA   <a href=\"http://ica-atom.org/about#partners\"> </a>                     .  <a href=\"about\"> </a> AtoM    .\n\n <a href=\"http://ica-atom.org/docs\"></a>       <i></i>     .',7,'ka'),('','  AtoM 1.0.7. .      . \n\nAtoM \'\'(ICA)     .AtoM   (Access to Memory) .\n\nICA ICA \' \'               . AtoM       \' \' .  \n\n        \'\' ,     \'\'  .    ',7,'ko'),('Welkom','Dit is de standaard homepage voor AtoM. Dit is een beta versie, nog onder ontwikkeling en testen.\n\nAtoM is een volledig web based applicatie voor het beschrijven van archieven, gebaseerd op <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standaarden. <i>AtoM</i> is een acroniem voor <i>Access to Memory</i>.\n\nDe ICA en zijn <a href=\"http://ica-atom.org/about#partners\">project partners</a> stellen deze applicatie beschikbaar als open source software, om archiefinstellingen te voorzien van een vrij en gemakkelijk te gebruiken voorziening om hun archiefcollecties online te zetten. Zie de <a href=\"about\">over pagina</a> voor meer informatie over het AtoM project.\n\nZie de online <a href=\"http://ica-atom.org/docs\">documentatie</a> voor meer informatie over het gebruik van de software of toets de <i>browse</i> knop aan de rechterkant om enkele voorbeelden te bekijken.',7,'nl'),('Witamy','To jest strona domowa AtoM. Jest to wersja beta, nadal podlegajca aktywnym testom i zmianom.\n\nAtoM jest opartym w peni na technologii web oprogramowaniem do opisu archiwalnego bazujcym na standardach <a href=\"http://www.ica.org/\">Midzynarodowej Rady Archiww (ICA)</a>. <i>AtoM</i> jest akronimem angielskich sw <i>Access to Memory</i>.\n\nMidzynarodowa Rada Archiww, wraz z <a href=\"http://ica-atom.org/about#partners\">partnerami projektu</a> tworz to oprogramowanie na zasadach open source, aby umoliwi instytucjom archiwalnym atw i swobodn metod publikowania swoich kolekcji online.\n\nZapoznajcie si ze stron <a href=\"about\">O projekcie</a> aby dowiedzie si wicej na temat AtoM.\n\nZachcamy rwnie do skorzystania z <a href=\"http://ica-atom.org/docs\">dokumentacji</a> aby dowiedzie si wicej na temat uytkowania programu lub kliknicia odnonika <i>browse</i> po prawej stronie, aby przeglda przykadowe dane demonstracyjne.',7,'pl'),('Bem-vindo','Esta  a pgina padro para o AtoM.\n\nAtoM  um aplicativo de descrio arquivstica integralmente voltado para web e baseado em <a href=\"http://www.ica.org/\">Conselho Internacional de Arquivos</a> (CIA) normas. <i>AtoM</i>  um acrnimo para <i>Access to Memory [Acesso  Memria]</i>.\n\nO CIA e seus <a href=\"http://ica-atom.org/about#partners\">colaboradores neste projeto</a> esto disponibilizando este aplicativo como software de fonte aberta para prestar apoio a entidades custodiadoras como uma opo gratuita e de fcil uso para colocar seus acervos arquivsticos online. Veja <a href=\"about\">about page</a> para saber mais sobre o projeto AtoM.\n\nVeja a <a href=\"http://ica-atom.org/docs\">documentao</a> para saber mais como utilizar o software ou pressione o boto <i>navegador</i> no lado direito para ver alguns exemplos.',7,'pt'),('Dobrodoli','To je privzeta domaa stran programa AtoM. Gre za beta verzijo, ki se aktivno razvija in testira.\n\nAtoM je v celoti spletni arhivski program, ki temelji na standardih Mednarodnega arhivskega sveta (ICA) <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standards. <i>AtoM</i> Atom je kratica za dostop do pomnilnika.\n\nS pomojo ICA in <a href=\"http://ica-atom.org/about#partners\">drugih sodelavcev pri projektu</a> je program dostopen kot odprtokodna programska oprema, ki institucijam z arhivi ponuja brezplano in preprosto monost objave svojih arhivskih zbirk na spletu. Glejte <a href=\"about\">o strani</a> za ve informacij o projektu AtoM.\n\nOglejte si spletno dokumentacijo <a href=\"http://ica-atom.org/docs\">dokumentacija</a> za ve informacij o uporabi programa ali kliknite gumb <i>ii</i> na desni strani za ogled primerov.',7,'sl'),('',' default homepage  AtoM \n\nAtoM   <a href=\"http://www.ica.org/\">International Council on Archives</a> (ICA) standards. <i>AtoM</i>  <i>Access to Memory</i>.\n\nICA <a href=\"http://ica-atom.org/about#partners\">  project </a>  open source software  <a href=\"about\"> about page </a>  AtoM project\n\n <a href=\"http://ica-atom.org/docs\"> documentation</a>    <i>browse</i> ',7,'th'),('Quant a',NULL,8,'ca'),('Sobre',NULL,8,'ca@valencia'),('Ynghylch',NULL,8,'cy'),('ber','Dies ist die vorgegebene Seite <i>ber</i> der Open-Source Anwendung zur archivischen Erschlieung AtoM. Fr den Einstieg in AtoM bentzen Sie die <a href=\"http://ica-atom.org/docs\">Dokumentation</a>. Hier erfahren Sie, wie Sie die Anwendung an die Gestaltung ihrer Webseite anpassen und editieren knnen.\n\nAtoM ist ein <a href=\"http://ica-atom.org/about#partners\">gemeinschaftliches Projekt</a>. Es mchte der internationalen archivarischen Gemeinschaft eine freie, auf Open-Source basierende Software-Anwendung zur Verfgung stellen, um Archivbestnde in bereinstimmung mit den ICA-Standards erschlieen zu knnen.\n\nZiel ist es, eine einfache, vielsprachige, komplett webbasierte Anwendung zur Verfgung zu stellen, die es Institutionen erlaubt, ihre Archivbestnde online vorzustellen.',8,'de'),('ber',NULL,8,'de-CH'),('',NULL,8,'el'),('About','This is the default <i>About</i> page for the AtoM open source archival description application. See the online <a href=\"http://ica-atom.org/docs\">documentation</a> to learn how to get started with AtoM, including how to customize and edit this page to suit your own website.\n\nAtoM is a <a href=\"http://ica-atom.org/about#partners\">collaborative project</a> with the aim to provide the international archival community with a free, open source software application to manage archival descriptions in accord with ICA standards.\n\nThe goal is to provide an easy to use, multilingual application that is fully web based and will allow institutions to make their archival collections available online.',8,'en'),('Acerca','sta es la pgina por defecto <i>Acerca</i> de la aplicacin para descripcin archivstica de cdigo abierto AtoM. Para informacin sobre cmo utilizar AtoM, personalizar y editar esta pgina segn las caractersticas de su propio sitio Web, consulte <a href=\"http://ica-atom.org/docs\">documentation</a> .\n\nEl proyecto AtoM <a href=\"http://ica-atom.org/about#partners\">collaborative project</a> tiene por objetivo proporcionar a la comunidad archivstica internacional una aplicacin gratuita de cdigo abierto para la administracin descripciones archivsticas en cumplimiento con estndares ICA.\n\nLa meta es poner a disposicin del usuario una aplicacin multilinge, de fcil uso y situada en la red, que permita a las instituciones publicar sus colecciones archivsticas en lnea.',8,'es'),('Buruz',NULL,8,'eu'),(' ',NULL,8,'fa'),(' propos','Vous tes sur la page <i> propos</i> du logiciel libre de description archivistique AtoM. Voir la <a href=\"http://ica-atom.org/docs\">documentation en ligne </a> pour apprendre  utiliser AtoM, l\'adapter  vos besoins et modifier cette page afin qu\'elle convienne  votre propre site Web.\n\nAtoM est un <a href=\"http://ica-atom.org/about#partners\">projet collaboratif</a> ayant pour but de fournir  la communaut archivistique internationale une application gratuite, disponible en code source libre, permettant de grer des descriptions archivistiques conformment aux normes de l\'ICA.\n\nLe but est de fournir une application facile  utiliser, multilingue et entirement base sur le Web qui permettra aux institutions de rendre accessible en ligne leurs collections archivistiques.',8,'fr'),('Acerca',NULL,8,'gl'),('Informacije',NULL,8,'hr'),('Info',NULL,8,'hu'),('Tentang Kami',NULL,8,'id'),('Um',NULL,8,'is'),('Riguardo','Questa  la pagina predefinita per le <i>Informazioni su</i> AtoM, un\'applicazione open-source per la descrizione archivistica. Si veda la <a href=\"http://ica-atom.org/docs\">documentazione</a> in linea per informazioni su come iniziare con AtoM, come personalizzare e tradurre questa pagina per adattarla al proprio sito web.\n\nAtoM  un <a href=\"http://ica-atom.org/about#partners\">progetto collaborativo</a> con lo scopo di mettere a disposizione della comunit archivistica internazionale un software gratis, libero e open source per gestire le descrizioni archivistiche nel rispetto degli standard ICA.\n\nL\'obiettivo  fornire un\'applicazione semplice e multilingua, accessibile interamente online e che permetta alle istituzioni di rendere fruibili online i propri fondi.',8,'it'),('',NULL,8,'ja'),('',NULL,8,'ka'),('About','   AtoM      .  AtoM      \'\' .          .\n\nAtoM   ICA                 .\n\n                   .',8,'ko'),('Over','Dit is de standaard <i>over...</i> pagina voor de AtoM open-source archivistisch beschrijvingsapplicatie. Kijk naar de online <a href=\"http://ica-atom.org/docs\">documentatie</a> om te leren hoe van start te gaan met deze applicatie, inclusief het aanpassen en bewerken van deze pagina om binnen uw eigen webpagina in te passen.\n\nAtoM is een <a href=\"http://ica-atom.org/about#partners\">samenwerkingsproject</a> met het doel om de internationale archiefwereld te voorzien van een vrij, open-source software applicatie om hun archiefbeschrijvingen te beheren conform de ICA-standaarden.\n\nHet doel is om een eenvoudig te gebruiken, meertalige applicatie, dat volledig web-gebaseerd is beschikbaar te stellen. Het geeft instellingen de mogelijkheid om hun archiefcollecties online beschikbaar te stellen.',8,'nl'),('O...',NULL,8,'pl'),('Sobre','Essa  a pgina padro <i>Sobre</i> do AtoM, um aplicativo de cdigo-fonte aberto para descrio arquivstica. Acesse a <a href=\"http://ica-atom.org/docs\">documentao</a> online para aprender como comear a usar o AtoM, incluindo como personalizar e editar essa pgina para inclu-la em seu site.\n\nAtoM  <a href=\"http://ica-atom.org/about#partners\">projeto colaborativo</a> que visa prover a comunidade arquivstica internacional de um software aplicativo gratuito e de cdigo-fonte aberto, para gerenciamento de descries arquivsticas em conformidade s normas do Conselho Internacional de Arquivos (ICA).\n\nO objetivo  disponibilizar um aplicativo fcil de usar, multilngue, e totalmente baseado na web, permitindo que instituies possam disponibilizar seus acervos arquivsticos on-line.',8,'pt'),('Sobre',NULL,8,'pt_BR'),('Sobre',NULL,8,'pt-BR'),('O programu','To je prednastavljena <i>About</i> stran za AtoM odprtokodno aplikacijo za popisovanje arhivskega gradiva. Glej \"online\" <a href=\"http://ica-atom.org/docs\">documentation</a>, kjer izve ve o tem kako zaeti delo s programom, vkljuno s tem, kako preoblikovati in urediti to stran za lastne potrebe.\n\nICA in njegovi <a href=\"http://ica-atom.org/about#partners\">sodelavci v projektu</a> so pripravili za potrebe mednarodne arhivske skupnosti prosto dostopno in odprtokodno aplikacijo za upravljanje arhivskih opisov v skladu z ICA standardi.\n\nNa cilj je pripraviti uporabno, vejezikovno spletno aplikacijo, ki bo omogoala ustanovam \"on line\" predstavitev njihovih arhivskih zbirk.',8,'sl'),('',NULL,8,'sr'),('Om',NULL,8,'sv'),('Ma\'lumot',NULL,8,'uz'),('V',NULL,8,'vi'),('',NULL,8,'zh'),('Polisi Preifatrwydd',NULL,9,'cy'),('Privacy Policy','##Website visitors##\n\nThis Access to Memory (AtoM) site is designed to allow users to browse and search for the holdings of archives, libraries and museums. Public users will not be asked to log in and will not be asked for any personally identifying information.\n\nHowever, like many modern websites, AtoM collects cookies in order to enable browsing and loading of certain types of content. A cookie is a string of information that a website stores on a visitors computer, and that the visitors browser provides to the website each time the visitor returns. Visitors to AtoM sites who do not wish to have cookies placed on their computers should set their browsers to refuse cookies. However, certain features may not function properly without the aid of cookies.\n\nAtoM supports integration with Google Analytics (https://www.google.com/analytics/) for the purposes of gathering statistics on page views, site usage, user location, and other data on site visits. All data collected by Google Analytics are stored and processed by Google, according to the Google Ads Data Processing Terms. (https://privacy.google.com/businesses/processorterms/)\n\nNone of the information gathered through the use of cookies or Google Analytics is used for any purpose other than the ones described above.\n\n##Logged-in users##\n\nUsers who log in have user accounts with usernames and passwords. These data are collected solely for the purpose of enabling users to log in to the software and are not disclosed to third parties. All AtoM user passwords are stored in encrypted form to enhance data security.',9,'en'),('Politique de confidentialit',NULL,9,'fr'),('Politika privatnosti',NULL,9,'hr'),('Kebijakan Privasi',NULL,9,'id'),('',NULL,9,'ja'),('Poltica de privacidade',NULL,9,'pt'),('Poltica de Privacidade',NULL,9,'pt_BR'),('Sekretesspolicy',NULL,9,'sv'),('Bem vindo','<!-- Google tag (gtag.js) -->\n<script async src=\"https://www.googletagmanager.com/gtag/js?id=G-ZFM6REHK5K\"></script>\n<script>\n  window.dataLayer = window.dataLayer || [];\n  function gtag(){dataLayer.push(arguments);}\n  gtag(\'js\', new Date());\n\n  gtag(\'config\', \'G-ZFM6REHK5K\');\n</script>',759,'en');
